import Element from './Element'
import './Timeline.css'

import amazonLogo from '../../images/companies/amazon_logo.png'
import feupLogo from '../../images/companies/feup_logo.png'

function Timeline() {
  return (
    <>
      <div className='timeline'></div>
      <Card side='right' logo={amazonLogo} role='Intern' startDate={''} endDate={''}/>
      <Card side='left' logo={feupLogo} role='Intern' startDate={''} endDate={''}/>
    </>
  )
}

export default Timeline;
